<h2 class=""sitename"" id=""US-MA-FREE""><b>1</b>  Freedom Trail</h2>

<!-- wp:paragraph -->
<p>The three-mile Freedom Trail leads you past - and into - 16 of the city's principal historic monuments and sites. It's easy to follow, by the line of red bricks in the sidewalk and by footprints at street crossings. Begin by picking up brochures on the attractions at the Visitor Center in the <b>Boston Common</b> before heading to the <b>State House</b>. The trail will take you to <b>Old Granary Burying Ground</b> (where Paul Revere, Samuel Adams, and John Hancock are buried), <b>King's Chapel Burying Ground</b> (Boston's oldest cemetery with the graves of Governor John Winthrop and two <i>Mayflower</i> passengers), <b>Old South Meeting House</b> (where the ringing speeches of patriots spawned the Boston Tea Party), and the <b>Old State House</b>. This is Boston's oldest public building and the <b>site of the Boston Massacre</b>. The trail continues through Boston's North End, past the <b>Paul Revere House</b>");
