<!-- wp:paragraph -->
<p>Known as ""America's Most Beloved Ballpark"", Fenway Park is one of the most fabled sports complexes in the country, and even if you're not a sports fan, a tour of it is both fun and interesting. The <b>home of the Boston Red Sox</b> looks much the same as it did when it opened on April 20, 1912. One of its most recognizable features is the Green Monster, the 37-foot green wall in left field, and the park still maintains some of the remnants of ""old time"" baseball such as the hand-operated scoreboard. It also has the lowest seating capacity in the Major Leagues holding only 33,871 spectators (a fact that makes tickets exceedingly scarce).</p>
<!-- /wp:paragraph -->



